import './App.css';
import { useState } from "react";
import Axios from 'axios';
import { Card } from "react-bootstrap";


function MyStash() {
    const [fabricList, setFabricList] = useState([]);

    const getFabrics = () => {
        Axios.get('http://localhost:3001/fabrics').then((response) => {
        setFabricList(response.data);
        });
    }

  return (
    <Card style={{ backgroundColor: "lavender", color: "black", width: "18rem" }}>
        <Card.Header>My Stash</Card.Header>
        <Card.Body>
        <button onClick={getFabrics}>Show Fabrics</button>
            {  
                <>
                   {fabricList.map((val, key) => {
                        <div className="fabrics"> 
                            <h3>{val.FabricTypeId}</h3>
                            <h3>{val.Color}</h3>
                            <h3>{val.PatternId}</h3>
                            <h3>{val.Yardage}</h3>
                            <h3>{val.Width}</h3>
                            <h3>{val.FabricSourceId}</h3>
                            <h3>{val.ScrapStatus}</h3>
                            <h3>{val.IntendedProject}</h3>
                        </div>
                    })}
                </>
            }
        </Card.Body>
    </Card>
  )
}

export default MyStash;
